import React from "react";

import classes from "./Header.module.css";
import navClasses from "./Nav.module.css";

import Nav from "./Nav";

const Header = () => {
  return (
    <header className={classes.header}>
      <Nav className={navClasses["mobile-nav"]} />
    </header>
  );
};

export default Header;
